import React, { Component } from "react";
import { App } from "./App";
import { getWatchData } from "./DataPaths";

// const client = new Client();

// client.get();
// client.search(query);

function AppContainer() {
  // console.table(this.state.data.watch_data);
  // console.log("this is the listen data:");
  // console.table(this.state.data.listen_data);

  const [watchData, setWatchData] = useState("");
  const [listenData, setListenData] = useState("");

  getWatchData().then(data => {
    console.table(watchData);
    console.table(listenData);
    console.log("returning app");
    setWatchData(data["watch_data"]);
    setListenData(data["listen_data"]);
  });

  return (
    <div>
      <App watchExperienceData={watchData} listenExperienceData={listenData} />
    </div>
  );
}

export default AppContainer;
